import {BrowserRouter, Route} from "react-router-dom";
import Main_page from "./components/pages/Main_page";
import Dictionary_page from "./components/pages/Dictionary_page";

function App() {
  return (
    <BrowserRouter>
      <Route path="/main_page" >
          <Main_page />
        </Route>
    </BrowserRouter>
  );
}

export default App;
